import React from 'react'
import Button from './button'
import styled from 'styled-components'

const Text = styled.p`
  font-size: 24px;
  margin: 0;
`

const Inner = styled.div`
  align-items: center;
  display: flex;
`

const Container = styled.div`
  align-items: center;
  color: white;
  display: flex;
  flex-direction: column;
  width: 300px;

  ${Inner} {
    margin-top: 24px;
  }
`

const Options = (props) => {
  const { number } = props

  return (
    <Container>
      <Text>Prueba encontrada #{number}:</Text>
      <Inner>
        <Button left />
        <Text>Sin pruebas</Text>
        <Button />
      </Inner>
    </Container>
  )
}

export default Options
